import React from "react";
import Gallery from "./components/galleryPage/Gallery";
import { Leftbar } from "./components/leftBar/LeftBar";
import "./App.css";

function App() {
  return (
    <div className="App">
      <div
        className="grid"
        style={{ gridTemplateColumns: "20% 80%", minHeight: "100vh" }}
      >
        <Leftbar></Leftbar>
        <Gallery class="gallery"></Gallery>
      </div>
    </div>
  );
}

export default App;
